`,n.jsx(A.p,{children:"例如，某些大厂管理者，很难在小团队里干出成绩。因为他刻板的把大厂的管理模式、流程、制度、生搬硬套搞到小团队里。这一套理论是正确的，成功的，但是他们忽视了小团队里的人员配置和时间等因素与打团队完全不一样，因此，最终的结果就是很难有符合预期的产出。"}),`
