`,n.jsx(A.p,{children:"在前面一章，我们基于项目架构整体，为大家分享了 MVC 模式的学习。但是我们知道，在 MVC 模式中，由于 M 数据模型层常常会由于需求的复杂性高、后端的配合度低等实际情况而变得非常复杂。在数据层，我们要处理的数据包括但不限于"}),`
`,n.jsx(A.p,{children:"1、定义应用层需要使用的数据类型"}),`
`,n.jsx(A.p,{children:"2、向服务端请求数据结果"}),`
`,n.jsx(A.p,{children:"3、验证返回的数据类型是否符合要求，例如，我们通常会使用 zod 进行类型判断"}),`
`,n.jsx(A.p,{children:"4、对接口返回的数据进行二次处理，以达到应用层的使用需求。这种情况是造成数据模型层复杂度非常高的主要原因。例如，我们前端封装好的一个 UI 组件需要的数据格式是一个树形结构。但是后端返回的接口却是一个扁平化的数组结构。那么此时，我们就需要针对该数组结构做二次处理以达到 View 层的使用标准。"}),`
`,n.jsx(A.p,{children:"因此，单独的只考虑 MVC 架构，还无法非常完整的处理好我们的项目架构。在此基础之上，我们还需要 BFF 架构理念来帮助我们进一步解耦数据层的复杂情况。"}),`
`,n.jsx(A.h3,{children:"二、BFF 架构"}),`
`,n.jsxs(A.p,{children:["BFF 架构是 Backend For Frontend 的简称。通常情况下指的是在前端与后端之间设计一个",n.jsx(A.strong,{children:"中间层"}),"，用于处理前后端之间数据的差异。例如，对于一个前端页面而言，需要的数据分别来自两个接口，如果把这个逻辑交给前端来处理，前端的场景就变得复杂了，我们需要思考如何在初始化直接请求两个接口的情况。"]}),`
`,n.jsxs(A.blockquote,{children:[`
`,n.jsx(A.p,{children:"由于缺乏架构思维的加持，许多自学成才的程序员就很难优雅的处理这种情况"}),`
`]}),`
`,n.jsx(A.p,{children:"那么此时，一个比较好的做法，就是在前端与后端之间，设计一个 node 服务，专门用于聚合处理后端多个接口的逻辑。然后对于前端来说，一个页面，或者一个组件单位，永远只有一个接口，这样处理起来就非常简单了。"}),`
`,n.jsx(A.p,{children:"这种解耦的做法，是把数据都处理从前端页面应用层剥离出去，后置于中间层。而这种加一个中间层的架构思维，就是 BFF 架构。"}),`
`,n.jsx(A.p,{children:"在一些比较大的团队中，经常会使用这种方案，在前端与后端之间还有一个中间层 node 端。在后端的项目全局架构思维中，BFF 架构思维多用于微服务架构。"}),`
`,n.jsx(A.p,{children:"但是这种做法，却并不是最完美的解决方案。主要的缺点表现如下"}),`
`,n.jsx(A.p,{children:"1、沟通成本高，团队沟通过程中方案的争议点比较多。通常情况下，中间层的逻辑职责划分并不明确，可以前端做，也可以后端做，也可以中间层做，因此，由于 node 中间层的存在，在项目管能力理薄弱的团队，往往会因此产生大量的争吵、甩锅、推诿等现象"}),`
`,n.jsx(A.p,{children:"2、维护成本更高。单独起一个 node 中间层服务，那么就需要专门针对 node 做更多的维护工作，包括日志、异常监控、稳定性维护、问题排查方案等等"}),`
`,n.jsx(A.p,{children:"3、进一步低智化、边缘化前端开发。在管理良好的 BFF 项目架构模式之下，前端开发所涉及的业务问题会更少，因此长期处于这种情况之下，普通前端开发会对项目整体架构的理解几乎一无所知，项目复杂度不够，从而缺乏核心能力的沉淀。"}),`
`,n.jsx(A.p,{children:"4、灵活性不足。如果中间层开发组与前端业务层开发组，不是同一波人，那么一些更具体的方案选择，灵活性会大打折扣。通常会遵循更为死板的架构标准，从而让简单的问题复杂化。例如：有的页面，如果本身只需要一个接口，但是由于 node 中间层的存在，及时本身就不需要进行额外的处理，但是也依然需要按照架构规范从 node 服务走一边。"}),`
`,n.jsx(A.h3,{children:"二、BFF 在前端项目中的运用"}),`
`,n.jsxs(A.p,{children:["我们可以脱离服务端，仅在单独的 react 前端项目中运用 ",n.jsx(A.code,{children:"BFF + MVC"})," 架构来解决数据层比较复杂的问题。"]}),`
`,n.jsxs(A.p,{children:["理念依旧是一样的，只是换了一个场景。我们只需要把 ",n.jsx(A.code,{children:"MVC"})," 模式中的 M 作为中间层来理解即可。核心的代码请看右侧案例演示"]}),`
